import React, { Component } from 'react';
import { Button, Text, Wrapper, StatisticsItem, StatisticsList, StatisticsName, StatisticsAmount } from './Opinion.styled'

class Opinion extends Component {
	state = {
		good: 1,
		neutral: 1,
		bad: 1,
	}

	render() {

		const { good, neutral, bad } = this.state
		return (
			<Wrapper>
				<Text> Please leave feetback</Text>

				<Button>Good</Button>
				<Button>Neutral</Button>
				<Button >Bad</Button>

				<Text>Statistics</Text>
				<StatisticsList>
					<StatisticsItem><StatisticsName>Good</StatisticsName><span>{good}</span></StatisticsItem>
					<StatisticsItem><StatisticsName>Neutral</StatisticsName><span>{neutral}</span></StatisticsItem>
					<StatisticsItem><StatisticsName>Bad</StatisticsName><span>{bad}</span></StatisticsItem>
				</StatisticsList>
			</Wrapper>
		);
	}
}
export default Opinion;
